INSERT INTO `barcel_news` VALUES ('13', '1', 'en', 'NEW  BARCEL POTATO CHIPS:  SEA SALT', null, 'news_1418852687.jpg', '<p>BARCEL takes potato chips very seriously.&nbsp;<br />\r\nWith the freshest potatoes, BARCEL POTATO CHIPS are highly appreciated for its flavor, thickness and its slowly-cooked crunchiness.<br />\r\nTo start 2015, &nbsp;we are proud to introduce the &nbsp;6th flavor &nbsp;to complete the Barcel Potato Chips portfolio:</p>\r\n\r\n<p style=\"text-align:center\"><strong>Barcel Potato Chips Sea Salt</strong></p>\r\n\r\n<p>A home-style, thick with great flavor in every slowly-cooked crunchy potato chip!<br />\r\nLook and ask for them in &nbsp;your favorite store.</p>\r\n', null, null, '0', '2014-12-16 20:59:32', '2017-02-13 23:52:00'), ('17', '1', 'en', 'NEW Takis Xplosion', null, 'news_1423233937.jpg', '<p>Have You PWN&#39;D Fuego?&nbsp; Then take on our newest</p>\r\n\r\n<p>challenger Takis Xplosion.&nbsp; This is the NEW Hot</p>\r\n\r\n<p>Cheese Flavor from Takis and is sure to make your</p>\r\n\r\n<p>tongue STOP, DROP and ROLL!</p>\r\n', null, '2015-02-06 00:00:00', '0', '2015-02-06 14:45:37', '2017-02-13 23:51:57'), ('25', '1', 'en', 'Paleta Payasita', null, 'news_1423675384.jpg', '<p>*LIMITED EDITION*<br />\r\nShe is the best friend of Paleta Payaso and she loves to come to town and visit him on special occasions.<br />\r\nThis lollipop makes everyone smile once they bite into her coat of crunchy and delicious white chocolate flavored crust. Inside, a treat of soft strawberry flavored marshmallow delights the senses and her sweet gummy eyes and mouth add an extra zing of taste.</p>\r\n', null, '2015-06-24 00:00:00', '0', '2015-02-11 17:23:04', '2017-02-13 23:47:06'), ('26', '1', 'en', 'Breaking News!', null, 'news_1435099432.jpg', '<p>Play the Brain Drain game to win a $700 gift card to buy whatever you want!&nbsp;Visit&nbsp;<a href=\"http://braindraingame.com\" target=\"_blank\">http://braindraingame.com/&nbsp;</a>or</p>\r\n\r\n<p><a href=\"https://www.facebook.com/bubulubu.us\">&nbsp;</a><a href=\"https://www.facebook.com/bubulubu.us\" target=\"_blank\">Facebook.com/Bubulubu</a><a href=\"https://www.facebook.com/bubulubu.us\">.us</a>&nbsp; for more details.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hurry, this contest ends August 31st. Only the best will win one of the five grand prizes. Play fast, win money!</p>\r\n', null, '2015-06-24 00:00:00', '0', '2015-06-23 22:43:52', '2017-02-13 23:47:04'), ('29', '1', 'en', 'WIN GAME TICKETS!', null, 'news_1487022224.jpg', '<p>Face the intensity with Takis and win game tickets!</p>\r\n\r\n<p>Find the official rules for each participating team on this promo:</p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/hawks.pdf\" target=\"_blank\">Atlanta Hawks</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/nets.pdf\" target=\"_blank\">Brooklyn Nets</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/mavs.pdf\" target=\"_blank\">Dallas Mavericks</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/warriors.pdf\" target=\"_blank\">Golden State Warriors</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/clippers.pdf\" target=\"_blank\">Los Angeles Clippers</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/lakers.pdf\" target=\"_blank\">Los Angeles Lakers</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/knicks.pdf\" target=\"_blank\">New York Knicks</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/suns.pdf\" target=\"_blank\">Phoenix Suns</a></p>\r\n\r\n<p><a href=\"http://barcel-usa.com/public/media/tickets/spurs.pdf\" target=\"_blank\">San Antonio Spurs</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', null, '2017-02-13 00:00:00', '0', '2017-02-13 21:43:44', '2017-02-13 23:46:37');
