INSERT INTO `barcel_products` VALUES ('1', '1', 'Takis Fuego ', 'Face the intensity with Takis Fuego, the original rolled tortilla chip covered in the perfect combination of chili and lime.  It is no wonder why this <strong>award-winning chip and its iconic purple bag have become synonyms for coolness and spiciness.</strong>', 'barcel_1.png', '19'), ('3', '1', 'Takis Nitro', 'Covered in habanero and lime, with a hint of cucumber, this Takis is just delicious!  Spice lovers indulge. It’s time to munch on Takis Nitro!', 'barcel_3.png', '16'), ('4', '1', 'Takis Fajita', 'The first created Takis has a delectable with an invigorating spice made with blends of natural salsa.', 'barcel_4.png', '15'), ('6', '1', 'Takis Salsa Brava', 'The hot sauce deliciousness of Takis Salsa Brava that will K.O. any other taste. Don’t fight it, give in to your desires to snack on Salsa Brava. ', 'barcel_6.png', '18'), ('5', '1', 'Takis Guacamole ', 'The most popular rolled tortilla chip with an authentic flavor for Guacamole lovers.  ', 'barcel_5.png', '17'), ('7', '1', 'Speedsters', 'Fuel up your life and dare to master the flavor of Speedsters. Beware of every bite, you might reach maximum taste velocity.', 'barcel_7.png', '14'), ('9', '1', 'Chips Fuego', 'The slowly cooked home-style Barcel potato chip with the burst of the Fuego flavor.  \r\nAn unbeatable combination.\r\n', 'barcel_9.png', '12'), ('8', '1', 'Chips Jalapeño', 'A zesty and tangy, south of the border flavor. The jalapeño peppers will deliver a stimulating wave of spice in every bite. Wait for the burn!', 'barcel_8.png', '13'), ('11', '1', 'Chips Diabla', 'A red hot devilish slowly cooked potato chip that is infused with chili spice created by fresh chiles to intensify the heat.', 'barcel_11.png', '11'), ('45', '1', 'Chips Habanero', 'A zesty and tangy, south of the border flavor. The habanero peppers will deliver a stimulating wave of spice in every bite. Wait for the burn!.', 'barcel_45.png', null), ('12', '1', 'Chips Limon Chipotle', 'The perfect combination of lime and smoky chipotle flavor, all in one thick-cut, super crunchy potato chip.', 'barcel_12.png', '9'), ('14', '1', 'Churritos Fuego ', 'The unmistakable Fuego flavor makes these Churritos really crank up the heat. ', 'barcel_14.png', '8'), ('13', '1', 'Churritos', 'Crispy sticks with crazy fun in every bite! Chile and lime go hand in hand to create an enchanting taste that can’t be denied. ', 'barcel_13.png', '7'), ('16', '1', 'Hot Nuts Fuego', 'The unmistakable Fuego flavor gives bold excitement in every mouthful.  Catch fire with just the right amount of spicy zing and its distinctive double crunch.', 'barcel_16.png', '6'), ('15', '1', 'Hot Nuts', 'Crunchy chile and lime peanuts covered in a crunchier shell, and that means double crunch in every bite', 'barcel_15.png', '5'), ('46', '1', 'Barcel Nuts Salados ', 'These premium salty peanuts are toasted to perfection and are a great source of protein.', 'barcel_46.png', '4'), ('17', '1', 'Barcel Nuts Enchilados', 'The spicy nuttiness that keeps everyone coming back for More', 'barcel_17.png', '1'), ('19', '1', 'Habanero', 'These kettle cooked potato chips are seared with fresh chiles using a recipe that has spanned generations. Delicious, spicy, and crispy every bite.', 'barcel_19.png', '3'), ('18', '1', 'Barcel Nuts Japones ', 'These Japanese style peanuts are coated with a crunchy layer and seasoned with an Asian influence flavor.   A must have for anyone.', 'barcel_18.png', '2'), ('20', '2', 'Chocoretas ', 'An invigorating mint coat blankets a rich chocolate flavored center to create a perfect combination that will leave your mouth feeling refreshed.', 'ricolino_6.png', '1'), ('22', '2', 'Ricofiesta', 'Fun and delicious assortment of 5 favorite Ricolino candies. Perfect for piñata stuffers, holidays or children’s parties. The bag contains: Pecositas, which are strawberry, orange, and blueberry flavored dots. Chicks, a coated gum. Bocadin, a peanut filled wafer coated in chocolate flavoring. Duvaleta, a soft candy filled pop with savory mango, strawberry and apple centers. And Panditas (gummy bears) a delicious gummy candy.', 'ricolino_7.png', '3'), ('23', '2', 'Moritas ', 'Moritas packs a ton of sour and sweet fruitiness in every bite. Strawberry and blackberry flavors provide a wonderful mix of soft on a crunchy candy. The amazing sugar dot coating and smooth jelly center pack the perfect flavor combination.', 'ricolino_5.png', '4'), ('24', '2', 'Bubulubu', 'This is the snack you can’t stop thinking about! Bubulubu brings together mouth-watering jelly and joyous marshmallow, and then wraps it in luscious chocolate flavor coating.', 'ricolino_2.png', '7'), ('25', '2', 'Kranky', 'Kranky is the perfect combination of cereal and chocolate flavor. With an unmistakable crunch and succulent choco-sweetness, a bite of this crispy-crunchy chocolate flake may make your taste buds dance. Mmm. ', 'ricolino_4.png', '6'), ('27', '2', 'Duvalin', 'A traditional Mexican favorite, this smooth, creamy frosting candy is featured in three flavors of Hazelnut Chocolate, Vanilla, and Strawberry. Each pack includes a mini plastic scoop to dig out the deliciousness. Taste two different flavors at once!', 'ricolino_3.png', '5'), ('29', '2', 'Paleta Payaso', 'This lollipop makes everyone smile once they bite into this delicious chocolate flavored coated marshmallow and it’s sweet gummies bring a zing of taste.   ', 'ricolino_1.png', '2'), ('30', '3', 'Cajeta Quemada', 'A traditional Mexican milk caramel topping to compliment any pancake, waffle, toast, fruit, ice cream or your favorite dessert… You name it... Squeeze it straight from the bottle until your heart is fulfilled.', 'coronado_1.png', '4'), ('31', '3', 'Cajeta Envinada', 'A hint of sophistication makes this authentic Mexican milk caramel topping even more tasteful.  Perfect for any dessert. It’s only a squeeze away.', 'coronado_2.png', '3'), ('32', '3', 'Paleton', 'Milk caramel lollipops! Yum! These traditional Mexican candies are made to be enjoyed anywhere, anytime and always with the best ingredients.', 'coronado_3.png', '2'), ('33', '3', 'Oblea Cajeta', 'A sweet tradition packed with flavor. Two delicate powdered wafers filled with a smooth & delicious milky spread and caramel make Obleas a savory treat.', 'coronado_4.png', '1'), ('34', '4', 'Vero Elote ', 'A mild spicy chile powder coats this corn shaped strawberry flavored lollipop. Spicy on the outside, yes, but a few invigorating licks reveal the delicious strawberry flavor beneath. This is one snack you can’t stop eating. ', 'vero_1.png', '7'), ('35', '4', 'Vero Mango', 'Beneath a layer of mild spicy chili powder, a sweet mango taste awaits that will leave you thrilled. Vero Mango’s flavors are captivating and this snack is incomparable in the way it delights the tastebuds. ', 'vero_2.png', '6'), ('36', '4', 'Vero Manita', 'Manita is the perfect strawberry and cherry lollipop in your future. Blessed with the ability to provide sugary sweetness to your taste buds and also give high fives, Manita is good luck to enjoy!', 'vero_9.png', null), ('37', '4', 'Vero Sandi Brocha ', 'Sandi Brochas is a sweet and spicy mouth-watering watermelon lollipop that is the perfect treat or dessert for any moment.', 'vero_8.png', null), ('38', '4', 'Vero Semaforo ', 'Green, yellow, red. Go, slow, stop. This lollipop looks like a traffic light and tastes amazing at first lick. Strawberry, pineapple, and lemon flavors provide more than enough to delight your senses for the entire ride. ', 'vero_6.png', '5'), ('39', '4', 'Vero Tarrito', 'Tarrito is sweet, sour, and bursting with pineapple and fruity flavors. This sweet treat may become addictive to the taste buds.', 'vero_7.png', '4'), ('40', '4', 'Vero Palerindas ', 'There are sweet and spicy lollipops and then there is Palerindas, the ultimate sweet and spicy treat. This tamarind hard candy lollipop is covered with chile powder and is extremely delicious. ', 'vero_10.png', null), ('41', '4', 'Vero Pica Fresa', 'The ultimate strawberry gummy mixed coated with a tingly layer of mild chili powder. This treat softens as you enjoy the spicy outer taste and ends with a delicious strawberry flavor sensation. ', 'vero_4.png', '3'), ('42', '4', 'Vero Pica Goma', 'This gummy starts with a face puckering jolt of sour and spicy flavors and ends with a satisfying sweet gummy bite.', 'vero_3.png', '2'), ('43', '4', 'Vero Rellerindos', 'Filled with delicious liquid tamarind flavor, this sweet and spicy candy is the master of candies. If you like tamarind then you’ll love Rellerindos.', 'vero_5.png', '1'), ('10', '1', 'Barcel Chips Habanero', 'A home-style, thick with great flavor in every slowly-cooked crunchy potato chip!\r\nA product directed to consumers with sophisticated palates that value:  thickness, texture, flavor and crunchiness of our potato chips.', 'barcel_10.png', '10'), ('2', '1', 'Takis Xplosion', 'Take on the new challenge. This is the new hot cheese flavor from Takis and its sure to make your tongue STOP, DROP and ROLL!', 'barcel_2.png', null);
